import React from 'react';
import ReactDOM from 'react-dom'
import logo from './logo.svg';
import './App.css';
import { render } from '@testing-library/react';

var questionState = false

function state(){
  console.log("hello world")
  if (questionState) questionState = false
  else if (!questionState) questionState = true
}

function addQuestion(){
  if (!questionState){
    return null  
  }else if (questionState){
    ReactDOM.render(
      <div class='question'>
        <form>
          <label>
            Question:<br/>
            <textarea type="text" rows='20' cols='70'/>
            <textarea type="text" name="name" rows='20' cols='70'/><br/>
            <input type="submit" value="Submit" />
          </label>
        </form>
      </div>, document.getElementById('root')
    )
  }
}

function App() {
  return (
    <div>
      <button onClick={()=>state()}>Add Question</button>

    </div>
  );
}

export default App;
